let seed;p5.prototype.pseudorandomSeed=function(string){seed=parseInt(string.slice(2,10),16)};p5.prototype.pseudorandom=function(min=0,max=1){seed^=seed<<13;seed^=seed>>17;seed^=seed<<5;const result=(seed<0?~seed+1:seed)%1e3/1e3;return min+(max-min)*result};p5.prototype.pseudorandomInteger=function(min,max){return Math.floor(this.pseudorandom(min,max+1))};p5.prototype.pseudorandomIntegers=function(n,min,max){const result=[];for(let i=0;i<n;i++){result.push(this.pseudorandomInteger(min,max))}return result};p5.prototype.pseudorandomBoolean=function(){return this.pseudorandom()<.5};p5.prototype.pseudorandomPick=function(list){return list[Math.floor(this.pseudorandom(0,list.length*.99))]};let lastPickedOption;p5.prototype.pseudorandomPickDifferent=function(list){if(list.length==0){return}if(list.length==1){return list[0]}let pickedOption;do{pickedOption=this.pseudorandomPick(list)}while(lastPickedOption==pickedOption);return lastPickedOption=pickedOption};const DEFAULT_SIZE=1e3;let k;p5.prototype.dimensionlessCanvas=function(width,height){const canvasWidth=width||DEFAULT_SIZE;const canvasHeight=height||width||DEFAULT_SIZE;k=Math.min(canvasWidth,canvasHeight)*DEFAULT_SIZE;this.createCanvas(canvasWidth,canvasHeight)};p5.prototype.dimensionless=function(x){return x*k/DEFAULT_SIZE};function generateTestToken(projectNumber){let data={};let hash="0x";for(var i=0;i<64;i++){hash+=Math.floor(Math.random()*16).toString(16)}data.hash=hash;data.tokenId=(projectNumber*1e6+Math.floor(Math.random()*1e3)).toString();return data}
